<script type="text/javascript">window.res={"res/import/07/079499991.json":'[{"__type__":"cc.Material","_name":"builtin-unlit","_effectAsset":{"__uuid__":"6dkeWRTOBGXICfYQ7JUBnG"},"_techniqueData":{"0":{"props":{"diffuseTexture":{"__uuid__":"02delMVqdBD70a/HSD99FK"}},"defines":{"USE_DIFFUSE_TEXTURE":true}}}},{"__type__":"cc.EffectAsset","_name":"builtin-unlit","techniques":[{"name":"opaque","passes":[{"blendState":{"targets":[{"blend":true}]},"rasterizerState":{"cullMode":0},"depthStencilState":{"depthTest":true,"depthWrite":true},"properties":{"diffuseTexture":{"value":"white","type":29},"diffuseColor":{"value":[1,1,1,1],"editor":{"type":"color"},"type":16},"alphaThreshold":{"value":[0.5],"type":13},"mainTiling":{"value":[1,1],"type":14},"mainOffset":{"value":[0,0],"type":14}},"program":"builtin-unlit|unlit-vs|unlit-fs"}]},{"name":"transparent","passes":[{"stage":"transparent","blendState":{"targets":[{"blend":true}]},"rasterizerState":{"cullMode":0},"depthStencilState":{"depthTest":true,"depthWrite":true},"properties":{"diffuseTexture":{"value":"white","type":29},"diffuseColor":{"value":[1,1,1,1],"editor":{"type":"color"},"type":16},"alphaThreshold":{"value":[0.5],"type":13},"mainTiling":{"value":[1,1],"type":14},"mainOffset":{"value":[0,0],"type":14}},"program":"builtin-unlit|unlit-vs|unlit-fs"}]}],"shaders":[{"hash":922858114,"glsl3":{"vert":"\\nprecision highp float;\\nuniform CCLocal {\\n  mat4 cc_matWorld;\\n  mat4 cc_matWorldIT;\\n};\\nuniform CCGlobal {\\n  mat4 cc_matView;\\n  mat4 cc_matViewInv;\\n  mat4 cc_matProj;\\n  mat4 cc_matProjInv;\\n  mat4 cc_matViewProj;\\n  mat4 cc_matViewProjInv;\\n  vec4 cc_cameraPos;\\n  vec4 cc_time;\\n  mediump vec4 cc_screenSize;\\n  mediump vec4 cc_screenScale;\\n};\\n#if CC_USE_SKINNING\\n  in vec4 a_weights;\\n  in vec4 a_joints;\\n  #if CC_USE_JOINTS_TEXTRUE\\n    uniform SKINNING {\\n      vec2 jointsTextureSize;\\n    };\\n    uniform sampler2D jointsTexture;\\n    #if CC_JOINTS_TEXTURE_FLOAT32\\n      mat4 getBoneMa
